to_px_factor = 31

activated = false

options = {"ak", "mp5", "smg", "thompson", "lr", "m2"}

selected = 1


function OnEvent(event, arg)

    if (event == "PROFILE_ACTIVATED") then
        EnablePrimaryMouseButtonEvents(true)
    end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
        activated = not activated
        OutputLogMessage("Activated: %s\n", tostring(activated))
    end

    if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
        if selected >= #options then
            selected = 1
        else
            selected = selected +1
        end
        OutputLogMessage("Selected: %s\n", options[selected])
    end

    if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then
    	start_ms = GetRunningTime()

        values = weapons[options[selected]]

		already_moved_x = 0
    	already_moved_y = 0

    	half_x_px = 0
    	half_y_px = 0
    	repeat
    		passed_ms = GetRunningTime() - start_ms
    		position = values[passed_ms]
    		if(position ~= nil) then
	    		now_move_y = position[2] - already_moved_y
	    		already_moved_y = already_moved_y + now_move_y
	    		move_y_px = (now_move_y * to_px_factor) + half_y_px
	    		move_y_px_floored = abs_floor(move_y_px)
				half_y_px = move_y_px - move_y_px_floored

	    		now_move_x = position[1] - already_moved_x
	    		already_moved_x = already_moved_x + now_move_x
	    		move_x_px = (now_move_x * to_px_factor) + half_x_px
	    		move_x_px_floored = abs_floor(move_x_px)
				half_x_px = move_x_px - move_x_px_floored

	    		MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)
    		end
            Sleep(math.random(1,5))
        until not IsMouseButtonPressed(1)
    end
end


function abs_floor(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end
